import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  setForm,
  handleSubmit
}) => {
  const handleChange = (e) => {
    setForm({
      ...form,
      [e.target.name]: e.target.value
      }
    )
  }
  return (
    <>
      <div>
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            name={name}
            onChange={()=>handleChange(e)}
            placeholder="Name"
            required >
          </input>
          <input
            type="text"
            name={phone}
            onChange={e => setName(e.target.value)}
            placeholder="Phone"
            required >
          </input>
          <input
            type="text"
            name={email}
            onChange={e => setName(e.target.value)}
            placeholder="Email"
            required >
          </input>
          <input type="submit"></input>
        </form>
      </div>
    </>
  );
};
